import React from 'react';
import Button from 'antd/lib/button';
import CSILogo from '../png/Logo.png'
import Main from './Main';
function Login() {
  return (
    <div className="App">
      <header className="App-header">

      </header>
      <main>
        <div>
        <img src={CSILogo} />
        <Button type="primary">Login</Button>
        </div>
      </main>
    </div>
  );
}

export default Login;
